import React, { Component } from 'react'
import About from './About';
import Skills from './Skills';
import Blog from './Blog';
import Contact from './Contact';


class Home extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            changeTab1:true,
            changeTab2:false,
            changeTab3:false,
            changeTab4:false,
            changeLogin:false
        }
    }
    ChangeTabLogin = ()=>{
        this.setState({ 
            changeTab1:false,
            changeTab2:false,
            changeTab3:false,
            changeTab4:false,
            changeLogin:true
            });
    }
    ChangeTabStatus1=()=>{
        this.setState({ 
            changeTab1:true,
            changeTab2:false,
            changeTab3:false,
            changeTab4:false,
            changeLogin:false

        })
        
    }
    ChangeTabStatus2=()=>{
        this.setState({ 
            changeTab1: false,
            changeTab2:true,
            changeTab3:false,
            changeTab4:false,
            changeLogin:false

        })}
    ChangeTabStatus3=()=>{
            this.setState({ 
                changeTab1: false,
                changeTab2:false,
                changeTab3:true,
                changeTab4:false,
            changeLogin:false

            })}
    ChangeTabStatus4=()=>{
                this.setState({ 
                    changeTab1: false,
                    changeTab2:false,
                    changeTab3:false,
                    changeTab4:true,
            changeLogin:false

                })}

    render() {

        return (
           <div>
            <About changeTab={this.state.changeTab1}
                //  dataExp={this.state.data && this.state.data.experience}
                //  dataEdu={this.state.data && this.state.data.education}
            />
            <Skills changeTab={this.state.changeTab2}
            // dataDesign={this.state.data && this.state.data.design}
            // dataCoding={this.state.data && this.state.data.coding}
            />
            <Blog changeTab={this.state.changeTab3}
                // dataBlog={this.state.data && this.state.data.infomation}
            />
            <Contact changeTab={this.state.changeTab4} 
                // dataContact={this.state.data && this.state.data.contact}
            />
           </div>
        )

    }
}

export default Home
